using System;\nusing System.Data.SqlClient;\n\npublic class StoredProcChecker\n{\n    public static void Main()\n    {\n        string connectionString = "YourConnectionStringHere";\n        string[] storedProcedures = { "StoredProc1", "StoredProc2" }; // Add your stored procedures here\n\n        using (SqlConnection connection = new SqlConnection(connectionString))\n        {\n            connection.Open();\n            foreach (var proc in storedProcedures)\n            {\n                try\n                {\n                    string query = $"SET FMTONLY ON; EXEC {proc}; SET FMTONLY OFF;";\n                    using (SqlCommand command = new SqlCommand(query, connection))\n                    {\n                        command.ExecuteNonQuery();\n                        Console.WriteLine($"{proc} compiled successfully.");\n                    }\n                }\n                catch (Exception ex)\n                {\n                    Console.WriteLine($"Error compiling {proc}: {ex.Message}");\n                }\n            }\n        }\n    }\n}